def calculate_eigenvalues(number_age_groups):
    rho= symbols('rho[0]:%d'%number_age_groups)
    S = symbols('S0:%d'%number_age_groups)
    N = symbols('N0:%d'%number_age_groups)
    T_I = symbols('T_I0:%d'%number_age_groups)
    phi = [list(symbols('phi' + str(i) + '_0:%d'%number_age_groups)) for i in range(number_age_groups)]
    # rho=[0.07333, 0.07333, 0.07333]
    # S=[9990, 9990, 9990]
    # N=[10000, 10000, 10000]
    # T_I=[8.0096875, 8.0096875, 8.2182]
    # phi=[[7.95/3, 7.95/3, 7.95/3],
    #      [7.95/3, 7.95/3, 7.95/3],
    #      [7.95/3, 7.95/3, 7.95/3]]
    next_gen_matrix = zeros(number_age_groups, number_age_groups)
    for i in range(number_age_groups):
        for j in range(number_age_groups):
            next_gen_matrix[i, j] = rho[i] * S[i] * phi[i][j] * T_I[j] / N[j]
    p = next_gen_matrix.charpoly(lamda)
    print(factor(p.as_expr()))

